import React from 'react';
import './ModalBook.css';


class ModalBook extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="modal">
          <div className="modal-context"></div>
      </div>
    );
  }
}


export default ModalBook;
